import React from "react";
import Table from 'react-bootstrap/Table'

function Layouts(props) {

    const conflict_hist = props;

    return (
        <div>
            <font color="red"><h1>Conflict Report 1</h1></font>
            <Table>
                <thead>
                    <tr>
                        <th>Course</th>
                        <th>CRN</th>
                        <th>UID</th>
                        <th>Last</th>
                        <th>First</th>
                        <th>Conflict</th>
                    </tr>
                </thead>
                <tbody>
                    { console.log(conflict_hist["conflict_hist"]) }
                </tbody>
            </Table>
        </div>
    );
}
export default Layouts;
